import React from 'react';
import '../App.css';

function App() {
  const [data, setData] = React.useState(null);
  React.useEffect(() => {
    fetch('/items?search=playstation')
      .then((res) => res.json())
      .then((data) => setData(data));
  }, []);

  return (
    <div className="App">
      <p>Holis</p>

    </div>
  );
}

export default App;
